import './App.css';
import { useState } from 'react'

import SearchAndPlotVehicleValue from './Components/SearchAndPlotVehicleValue/SearchAndPlotVehicleValue';


function App() {

  const [vehicleInformation, setVehicleInformation] = useState(null);

  return (
    <div className="App">
      <SearchAndPlotVehicleValue setVehicleInformation={setVehicleInformation}/>
      {vehicleInformation && <GraphPlotOptionsPanel />}
    </div>
  );
}

export default App;
